import { render } from '@testing-library/react';
import React from 'react';
import {Image, Button, Icon, Label, Divider} from 'semantic-ui-react';
import Comments from './comment.js';

import sw from "./sw.jpeg";



function App() {
  return (
    <div className="App">

      <Image src={sw} centered/>
      <Button as='div' labelPosition='right' style={{marginLeft:"400px"}}>
      <Button color='red'>
        <Icon name='heart' />
        Like
      </Button>
      <Label as='a' basic color='red' pointing='left'>
        2,048
      </Label>
      </Button>
    <Comments/>
    </div>
  );
}

export default App;
